import Home from './component/home/Home';
import About from './component/about/About';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (

    <Router>
    <>
    <Routes>
       <Route path= "/" element={<Home />} />  {/*If user asking for Home take slash */}

    </Routes>
    </>

    </Router>
  );
}

export default App;
